import React, {useState} from 'react';
// import {Navigate} from 'react-router-dom';
// import Axios from'axios';
import './doctorDashboard.css'
import Head from '../partials/head'
import {FaBars} from 'react-icons/fa';
// import * as AiIcons from 'react-icons/ai';
import { IconContext } from 'react-icons/lib';
import {Link} from 'react-router-dom';
// import { SidebarData } from './sidebar';
import Axios from 'axios';
// import Footer from './footer'
// import { useParams } from 'react-router-dom';
import * as AiIcons from 'react-icons/ai';
import * as RiIcons from 'react-icons/ri'
import * as MdIcons from 'react-icons/md';
import { Nav, NavDropdown } from 'react-bootstrap'
import { Navigate, useNavigate } from 'react-router-dom'




function DoctorDashboard() {


  
 
    
  const [sidebar, setSidebar] = useState(true)
  
  



    const [name, setName] = useState('')
    const [password, setPassword] = useState('')
    const [designation, setDesignation] = useState('')
    const [gender, setGender] = useState('')
    const [address, setAddress] = useState('')
    const [highest_qualification, setHighest_qualification] = useState('')
    
    
    const ShowSidebar = () => setSidebar(!sidebar)


    let navigate = useNavigate()

    const logout = ()=>{
      Axios.get('http://localhost:3001/logout')
      localStorage.clear()
      navigate('/')
    }






    const [username, setusername]=useState()

    const Full_Name = ()=>{
      Axios.get('http://localhost:3001/full_name').then((res)=>{
        var string = JSON.stringify(res.data)
            
        var json = JSON.parse(string)

        setusername(json[0].name)

      })
    }

    Full_Name();





    
const getData = () =>{

    Axios.post('http://localhost:3001/profile').then((res)=>{
      var string = JSON.stringify(res.data)
      var json = JSON.parse(string)
      
      // alert("hello"+json[0].signin_id);

      // setID(json[0].signin_id)
      setName(json[0].name)
      setPassword(json[0].password)
      setDesignation(json[0].designation)
      setGender(json[0].gender)
      setAddress(json[0].address)
      setHighest_qualification(json[0].highest_qualification)

      // alert(json[0].signin_id +"\n"+ name+"\n"+password+"\n"+designation+"\n"+gender+"\n"+address+"\n"+highest_qualification)

      // alert(signin_id +"\n"+ name+"\n"+password+"\n"+designation+"\n"+gender+"\n"+address+"\n"+highest_qualification)





    })

  }



  getData();

        // alert( name+"\n"+password+"\n"+designation+"\n"+gender+"\n"+address+"\n"+highest_qualification)


    return(
      <div>
        

        <Head></Head>
        
              <IconContext.Provider value={{color: '#c4d8e2'}}>
          <div>
            <nav className="navbar navbar-light navbar-expand-md navigation-clean" style={{backgroundColor: '#0072c6'}}>
          <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            <Link to='#' className='menu-bars'>
            <FaBars onClick={ShowSidebar}/>
            </Link>
              <div className="container" style={{fontSize:'10vw'}}>
              <img src='https://icon-library.com/images/healthcare-icon/healthcare-icon-7.jpg' style={{height:'80px', width:'80px', position:'absolute', right:'57%'}}/>
                <a className="navbar-brand" href="#" style={{color: '#c4d8e2', textAlign: 'center', margin: 'auto'}}>Tele Healthcare</a>
              </div>
              <Nav>
                <NavDropdown title={name}>
                    <NavDropdown.Item onClick={logout}>Logout</NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </nav>
          </div>
          <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
            <ul className='nav-menu-items' /*onClick={ShowSidebar}*/>
                <li className='navbar-toggle'>
                    {/* <Link to='#' className='menu-bars'>
                        <AiIcons.AiOutlineClose/>
                    </Link> */}
                </li>
                

                <li key='Profile' className='nav-text'>
                            <Link to={`/profile/${name}/${password}/${designation}/${gender}/${address}/${highest_qualification}`} >
                                <RiIcons.RiProfileLine/>
                                <span>Profile</span>
                            </Link>
                        </li>


                        

                        <li key='Patients' className='nav-text'>
                            <Link to='/patients' >
                            <MdIcons.MdOutlineLocalHospital/>
                                <span>Patients</span>
                            </Link>
                        </li>

                        <li key='Meetings' className='nav-text'>
                            <Link to='/meetings' >
                            <AiIcons.AiFillVideoCamera/>
                                <span>Meetings</span>
                            </Link>
                        </li>

                        <li key='Appointments' className='nav-text'>
                            <Link to='/appointments' >
                            <MdIcons.MdOutlineMeetingRoom/>
                                <span>Appointments</span>
                            </Link>
                        </li>



                {/* {SidebarData.map((item, index)=>{
                    return(
                        <li key={item.title} className={item.cName}>
                            <Link to={item.path}>
                                {item.icon}
                                <span>{item.title}</span>
                            </Link>
                        </li>
                    )
                })} */}
            </ul>
          </nav>
          </IconContext.Provider>
          {/* <Footer/> */}
        </div>
        
    )

}
export default DoctorDashboard;
